import logo from './logo.svg';
import React, { useState } from 'react';

function Header (){
  return (
          <header id="header">
              <div class="logo">
                  <span class="icon fa-chart-bar"></span>
              </div>
              <div class="content">
                  <div class="inner">
                      <h1>Desafio Indwise</h1>
                      <p> análise exploratória de dados</p>
                  </div>
              </div>
              <nav>
                  <ul>
                      <li><a href="#intro">Sobre</a></li>
                      <li><a href="#work">Gráficos</a></li>
                      <li><a href="#contact">Contato</a></li>
                  </ul>
              </nav>
          </header>           
  )
}

function Footer(){
  return(
    <footer id="footer">
        <p class="copyright">&copy; Desafio Indwise - Anna Puga.</p>
    </footer>
  )
}

function App() {

  return (
    <div className="App">

      <div id="wrapper">

        <Header></Header>

        <Footer></Footer>

      </div>

      <div id="bg"></div>

      <script src="assets/js/jquery.min.js"></script>
      <script src="assets/js/browser.min.js"></script>
      <script src="assets/js/breakpoints.min.js"></script>
      <script src="assets/js/util.js"></script>
      <script src="assets/js/main.js"></script>

    </div>

  );
}

export default App;
